import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Welcome to My IMDb Clone</h1>
      <Link to="/movies">View Movies</Link><br />
      <Link to="/mymovies">My Bookmarked Movies</Link>
    </div>
  );
};

export default Home;
